ft.\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','100% wool',0,0,0,9,100,'','30 day limited manufacturer warranty','Blot spills immediately, vacuum on low suction, periodic professional cleaning.','','','',36.00,'default',2650,NULL,'IN',NULL,NULL,NULL,NULL,NULL,NULL,'free',NULL,0,'2015-06-19 19:18:41','2011-08-25 08:00:00','2015-06-01 17:13:28'),(260067,'SENSASEN-3GLD','Cressida Wool Blend Rug - Gold',3188,'','As unique as it is striking, Sensations is an elegant group of transitional designs, all of which feature an exceptional over-tufting technique. Tufted of wool, each design is over-tufted with supple art-silk, further enhancing their beauty.\n- Color: gold\n- Imported\n\nProduct measurements:\n- 4ft. x 6ft. (actual: 3ft. 6in. x 5ft. 6in.)\n- 5ft. x 8ft. (actual: 5ft. x 7ft. 6in.)\n- 8ft. round (actual: 7ft. 6in. round)\n- 8ft. x 10ft.\n- 10ft. x 13ft. (actual: 9ft. 6in. x 13ft.)\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','80% wool, 20% viscose',0,0,0,11,100,'','30 day limited manufacturer warranty','Blot spills immediately, vacuum on low suction, periodic professional cleaning.','','','',78.00,'default',2650,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-08-25 08:00:00','2015-06-01 17:14:42'),(260068,'SENSASEN-5CHR','Kendall Wool Blend Rug - Charcoal',3188,'','A beautiful combination of wool and art-silk give these hand crafted rugs an artisan look while offering modern colors and great textures.\n- Color: charcoal\n- Imported\n\nProduct measurements:\n- 2ft. x 3ft.\n- 5ft. x 8ft. (actual: 5ft. x 7ft. 6in.)\n- 10ft. x 13ft. (actual: 9ft. 6in. x 13ft.)\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','80% wool, 20% viscose',0,0,0,142,100,'','30 day limited manufacturer warranty','Blot spills immediately, vacuum on low suction, periodic professional cleaning.','','','',93.00,'default',2650,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'free',NULL,0,'2015-06-19 19:18:41','2011-08-25 08:00:00','2015-06-01 17:17:40'),(262256,'GE5919','Chef\'s Classic Stainless Steel 7-Piece Cookware Set',3505,'','The kitchens of France were the inspiration behind the elegant Cuisinart Chef\'s Classic Stainless Cookware Collection. Chef\'s Classic features stainless steel and pure aluminum encapsulated in the base for fast and even heating. \n- Mirror finish\n- Aluminum encapsulated base heats quickly and spreads heat evenly, eliminates hot spots\n- Stainless steel cooking surface does not discolor, react with food or alter flavors\n- Solid stainless steel riveted handle stays cool on the stove top, helper handle provides extra support and balance when lifting and pouring. \n- Rim is tapered for drip-free pouring\n- Tight fitting cover seals in moisture and nutrients for healthier, more flavorful results, every time you cook\n- Set of seven\n- Imported \n\nSet includes: \n- 1 1/2 qt. saucepan with lid\n- 3 qt. saucepan with lid\n- 10\" open skillet\n- 8 qt. stockpot with lid\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,65,100,'','Lifetime limited manufacturer warranty','Clean with soap and water','Stainless steel','','',13.00,'default',2389,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-08-29 08:00:00','2015-06-01 17:18:13'),(280993,'7M40293','Lucky Brand SUNSET PLAID',8166,'','','',1,0,0,34,100,'','','','','','',1.00,'default',1722,NULL,'US','sizechart-men.png','MeasuringGuides_Men.png',NULL,NULL,NULL,NULL,'weight',NULL,1,'2015-06-19 19:18:41','2011-10-24 08:00:00','0000-00-00 00:00:00'),(284438,'V00674','5.5 Qt Black Stand Mixer',3505,'','The one stop solution for all of your mixing needs, this professional grade mixer is both powerful and sleek--perfect for your kitchen. \n- Tilt-back head\n- Top cover\n- 3 power ports\n- 5.5 quart stainless steel bowl with handles\n- Head-lift release lever securely locks stand mixer head into raised tilt-back position\n- On/Off, fold and speed control dial\n- 12 speeds for precision mixing\n- 15-minute countdown timer with auto shutoff\n- Chef\'s whisk\n- Flat mixing paddle\n- Dough hook\n- Splashguard with pour spout\n- Power: 800 Watts\n- Cord: 6 ft. length\n- 15.5\" W x 10\" D x 12.5\" H \n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,25,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',21.00,'default',2031,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284440,'V32112','12-Cup Programmable Thermal Coffeemaker',3505,'','With a plethora of state of the art features and a handsome, crisp classic design this machine is a coffee lover\'s top choice!\n- Classic design with stainless accents\n- Fully automatic with 24-hour programmability\n- 12 (5 oz.) cup double-wall insulated stainless steel carafe\n- Patented \"Brew Through and Pour Through Lid\" that keeps air out and coffee fresh and hot for hours\n- Automatically shuts off and sounds a \"beep\" after brewing is complete\n- Brew pause feature lets you enjoy a cup of coffee before brewing has finished\n- Easy-to-see water level indicator\n- Instruction book\n- Power: 800 Watts\n- Cord: 3 ft. length\n- 7.25\" W x 11.25\" D x 15.38\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,104,100,'','3 year limited manufacturer warranty','Clean with soap and water','Plastic, stainless steel','','',9.00,'default',1005,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284443,'DQ3197','Espresso Maker',3505,'','This espresso maker is the real thing and looks like the professional it is. You can even heat the cups on the warming plate on top--just like the pros.\n- 15 bars of pressure\n- 53 ounce removable reservoir\n- Brews one or two cups\n- Professional grade stainless steel housing and embossed Cuisinart logo\n- Stainless steel steam nozzle for cappuccino and latte\n- Porta-filter holder with locking mechanism that makes it easy to dispose of wet grounds after use\n- Removable drip tray and cover for easy cleanup\n- Warming tray on top\n- Includes tamping tool with measuring spoon and stainless frothing cup \n- Cord: 3 ft. length\n- Power: 1000 Watts\n- 12.56\" W x 8.19\" D x 10.94\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,52,100,'','3 year limited manufacturer warranty','Hand wash','Stainless steel','','',15.00,'default',1006,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284444,'V00660','Brushed Stainless Steel Custom 14-Cup Food Processor',3505,'','This easy-to-use, large capacity food processor speeds up all your cooking -- from quick weeknight meals to weekend celebrations. \n- 14 cup work bowl with handle\n- Work bowl cover with extra large feed tube\n- Large pusher and sleeve assembly\n- Small feed tube and pusher\n- Stainless steel standard slicing disc (4mm) and medium shredding disc\n- Stainless steel chopping/mixing blade and dough blade\n- Detachable disc stem\n- Spatula\n- How-to video and instruction/recipe book\n- Power: 720 watts\n- Cord: 3 ft. length\n- 7.5\" W x 9.75\" D x 15.75\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,35,100,'','3 year limited manufacturer warranty','Dishwasher safe parts','Stainless steel','','',19.00,'default',3160,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284445,'CA0543','Prep 9-Cup Food Processor',3505,'','This food processor is the ideal prep tool for any task -- its compact build allows it to fit comfortably on any counter top and the large work bowl makes it easy to create an entire meal from scratch. \n- 9-cup lexan work bowl\n- Extra-large feed tube slices whole fruits and vegetables\n- One-piece Cuisinart Supreme feed tube\n- Stainless steel medium slicing disc (4mm)\n- Stainless steel shredding disc\n- Chopping/mixing blade\n- Dough blade\n- Detachable disc stem\n- Spatula\n- Recipe/instruction book\n- How-to-DVD\n- Power: 600 watts\n- Cord: 3 ft. length\n- 10.13\" W x 7.75\" D x 14.75\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,51,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel, plastic','','',15.00,'default',3160,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284453,'CA0524','Round Classic Waffle Maker',3505,'','Start your day off with a fresh, luxurious Belgian waffle in your own home.\n- Bakes one large traditional-style waffle\n- Five-setting browning control\n- Regulating thermostat\n- Red and green \"ready to bake/ready to eat\" indicator lights\n- Nonstick baking plates\n- Brushed stainless steel housing\n- Includes instruction/recipe book\n- Cord: 3 ft. length\n- 7.88\" W x 9.69\" D x 3.31\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,108,100,'','3 year limited manufacturer warranty','Hand wash','Stainless steel','','',9.00,'default',2030,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(284454,'CA0551','Non-Stick Hard Anodized 17-Piece Cookware Set',3505,'','This handsomely crafted cookwear set will provide you with a lifetime of consistent and stylish cooking. \n- Hard anodized construction\n- Quantanium nonstick interior\n- Cast stainless steel\n- Cool grip riveted handles\n- Tempered glass lids\n- Drip-free rims\n- Oven safe to 500 degrees\n- Set of seventeen\n- Imported\n\nSet includes: \n- 1.5 qt. saucepan with lid\n- 2 qt. saucepan with lid\n- 3 qt. saucepan with lid\n- 8\" skillet\n- 10\" skillet\n- 12\" skillet with helper handle with lid\n- 4 qt. saute with helper handle with lid\n- 9 qt. stockpot with lid\n- 8\" multi-steamer insert with lid\n- 9.5\" pasta insert\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,113,100,'','Lifetime limited manufacturer warranty','Clean with soap and water','Hard anodized cast stainless steel','','',36.00,'default',2389,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(285250,'V00652','6-Quart 1000W Electric Pressure Cooker',3505,'','Cuisinart updates a classic! The brushed stainless pressure cooker is safe, easy to use, cooks up to 70% faster than conventional methods, and cooks healthier, too. Steam trapped in the pot builds up pressure that creates hotter temperatures, and with the pot tightly sealed the vitamins and minerals won\'t boil away.\n- Features variable pressure and temperature settings, plus browning, simmering and saute functions \n- Locked lid safety feature can be locked in place before pressure builds & stays locked until pressure is released. \n- Fingerprint-proof brushed stainless steel \n- Digital thermostat\n- Push button control for cooking options and programmed settings: low & high pressure, browning, simmer, saute and automatic keep warm settings\n- 99-minute time and LED countdown display\n- Cool-touch side handles\n- Nonstick cooking pot\n- Trivet included\n- 6 qt. capacity\n- Power: 1000 watts\n- Cord: 3 ft. length\n- 13\" H x 12\" diameter\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,153,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',15.00,'default',3184,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(285251,'V46517','Chef\'s Classic 10-Piece Cookware Set',3505,'','The kitchens of France were the inspiration behind the elegant Cuisinart Chef\'s Classic Stainless Cookware Collection. Chef\'s Classic features stainless steel and pure aluminum encapsulated in the base for fast and even heating.\n- Mirror finish \n- Aluminum encapsulated base heats quickly and spreads heat evenly\n- Eliminates hot spots\n- Great for classic cooking techniques like slow simmers, rolling boils and reduction of liquids\n- Solid stainless steel riveted handle stays cool on the stove top\n- Helper handle provides extra support and balance when lifting and pouring\n- Set of ten\n- Imported\n\nSet includes: \n- 1.5 qt. saucepan with cover \n- 3 qt. saucepan with cover\n- 3.5 qt. saute pan with helper handle & cover \n- 8\" open skillet \n- 10\" open skillet \n- 8 quart stockpot with cover\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,79,100,'','Lifetime limited manufacturer warranty','Clean with soap and water','Stainless steel','','',21.00,'default',2389,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-10-17 08:00:00','2015-06-01 17:18:13'),(310216,'35348','Metal Woven Brown Chair Swing',8702,'','Swing into a tropical mood in this faux wicker chair.\n- Color: brown\n- Metal frame and stand\n- Plastic woven wicker\n- Cushion included\n- Assembly required\n- Weight capacity: 275 pounds\n- 80\" H x 36\" W\n- Imported','',0,0,0,13,100,'','','Wipe with soft cloth','Metal, plastic woven material','','',116.00,'default',2907,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-18 08:00:00','2015-06-01 17:28:19'),(315049,'V00651','1000-Watt Compact Stainless Steel Deep Fryer',3505,'','Cuisinart presents a deep fryer that takes up less counter space and is designed to fry batches up to 3/4 of a pound in just 1 liter of oil. This is a great deep fryer even for spur-of-the-moment snacks and meals. The compact design allows creative cooks to prepare fried calamari to top a salad, and moms to fry up mozzarella sticks for kids. Easy to use, easy to clean, and simple to store, it could make deep frying an everyday event.\n- Fry basket holds up to 3/4 pounds\n- Fast heat-up and frying\n- Maximum oil capacity is 1.1 liter\n- Nonstick die-cast bowl with attached heating element for superior heating\n- Removable charcoal filter for odor removal\n- Temperatures up to 375 degrees F\n- Adjustable thermostat\n- Brushed stainless steel housing\n- Power: 1000 watts\n- Cord: 3 ft. length \n- 11.22\" W x 8.07\" L x 7.68\" D\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,94,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',9.00,'default',3184,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-07 08:00:00','2015-06-01 17:18:13'),(315054,'DE6001','12 Cup Programmable Hot Water System Coffeemaker',3505,'','Fresh, delicious coffee is only the beginning! This incredible hot beverage machine comes complete with all your favorite features, like 24-hour programmability, carafe temperature control, brew pause, and the ultra-convenient hot water system. Now, you\'re never more than a minute away from enjoying your favorite instant soup, hot cocoa, tea and more.\n- 12-cup carafe with a drip-free pour spout and a comfortable handle\n- Fully automatic with auto-on and auto shutoff, self-clean function and 1-4 cup setting\n- Blue backlit LCD with digital clock brightly displays everything at an easy-to-read glance\n- Carafe temperature control offers a heater plate with high, medium and low settings to keep coffee at the temperature you prefer\n- Brew pause feature lets you enjoy a cup of coffee before the brewing cycle has finished\n- Charcoal water filter and gold tone filter remove impurities that can alter the taste of your beverages\n- Hot water on demand heats up fast to let you enjoy oatmeal, soup, tea, cocoa, and more any time you like. simply press the lever to dispense hot water\n- Easy to use indicator lights let you know when water is hot and ready to dispense, and when it\'s time to refill\n- Removable drip tray leaves you plenty of room for tall travel mugs\n- Separate hot water system has its own power button and 54-ounce water reservoir; operates independently or at the same time as the coffeemaker\n- Safety feature prevents hot water from being dispensed\n- Charcoal water filter removes impurities that can alter the taste of your beverage\n- All materials that come in contact with water or coffee are BPA free\n- Power: 110V\n- Cord: 3 ft. length \n- 10.25\" W x 9.50\" L x 14.30\" D\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,67,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',9.00,'default',1005,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-07 08:00:00','2015-06-01 17:18:13'),(315056,'DQ3195','SmartPower Compact Portable Blending/Chopping System',3505,'','Meet the Cuisinart Smartpower: compact portable blending/chopping system - the slim and trim powerhouse that does it all. Use the streamlined blender jar to make smoothies in a flash. Mince herbs in the chopping cup and whip up custom drinks right in the travel cups - we\'ve included four of them so everyone can have their favorite. Designed to fit anywhere, the compact portable blending/chopping system delivers big-blender performance, with a 350-watt motor and the ease of single-hand operation with the user-friendly electronic touchpad! Stainless steel accents create an attractive, fashionable addition to any kitchen. New bpa free tritan from eastman co-polyester is used for the all vessels - blender jar, chopping cup and your travel cups. They are all shatter resistant and dishwasher safe. A real timesaver, cleanup and maintenance become simple chores. \n- Sleek electronic touchpad with led indicator lights\n- Powerful 350-watt\n- High, low and pulse controls\n- Standby mode; safety interlock and auto stop features\n- Brushed steel housing with stainless steel front pane\n- BPA-free tritan 32-oz. blender jar, 8-oz. chopping cup, and set of four 16-oz. travel cups\n- Patented ultra sharp stainless steel blades\n- Cord: 3ft. length\n- 8\" W x 14\" H x 8\" L\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,49,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',9.00,'default',2032,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-07 08:00:00','2015-06-01 17:18:13'),(315057,'KV0241','PerfecTemp Cordless Electric Kettle',3505,'','For tea to reach its full flavor, it should be steeped at just the right temperature. The Cuisinart: perfec temp electric kettle has 6 preset temperatures for different varieties of tea. 1500-watts provide fast heat-up, and a keep warm option will maintain the set temperature for 30 minutes. The kettle can even be removed from the power base for up to 2 minutes without shutting off. Cuisinart continues to make life civilized, easy and delicious.\n- 1.7-liter capacity\n- 6 preset temperatures\n- One-touch controls with blue led indicators\n- 30-minute keep warm option\n- Memory feature allows kettle to be lifted off base for 2 minutes without shutting off or losing its place in the brewing process\n- Blue backlit water window\n- 360 degrees swivel cordless connector\n- Stay-cool nonslip handle\n- Concealed heating element to prevent mineral buildup\n- Removable/cleanable scale filter\n- Auto shutoff and boil dry protection\n- Power: 1500 watts\n- Cord: 3ft. length\n- 8.8\" W x 6.1\" L x 9.75\" D\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,105,100,'','3 year limited manufacturer warranty','Clean with soap and water','Stainless steel','','',9.00,'default',2625,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-07 08:00:00','2015-06-01 17:18:13'),(315066,'V32102','Brew Central 12-Cup Programmable Coffeemaker',3505,'','Introducing an evolutionary new look in coffeemakers. The Cuisinart brew central coffeemaker makes a bold statement with a brushed metal finish and an elegant tech-industrial design. Programmable from start to finish, with a variable heater plate for temperature control, it\'s the ideal coffeemaker for today\'s demanding consumer. It even tells you when it\'s time to clean. Cuisinart quality, performance and convenience - now in new state-of-the-art packaging.\n- 12-cup carafe with ergonomic handle, dripless spout and knuckle guard\n- Brew pause feature lets you enjoy a cup of coffee before brewing has finished\n- Adjustable keep-warm temperature control\n- 24-hour brew programming\n- Time-to-clean monitor with indicator light\n- Programmable automatic shut-off 0-4 hours\n- 1 to 4-cup feature\n- Cord storage\n- Charcoal water filter (removes impurities)\n- Gold tone filter and measuring scoop\n- #4 paper coffee starter kit\n- Instruction book included \n- All materials that come in contact with water or coffee are BPA free\n- Power: 110V \n- Cord: 3 ft. length\n- 7.75\" W x 9\" D x 14\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,57,100,'','3 year limited manufacturer warranty','Clean with soap and water','Black stainless steel','','',9.00,'default',1005,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2011-12-07 08:00:00','2015-06-01 17:18:13'),(315073,'V00666','White Mini-Prep Plus Food Processor',3505,'','The Mini-Prep plus is the perfect little helper for small food preparation, from chopping herbs or bread crumbs, to finely grinding hard cheese. Its versatility lies in the special auto reversing smart blade, which makes it easier to process both soft and hard foods. Designed in Italy with the same look as Cuisinart\'s newly launched Powerprep Plus, the mini-prep plus\' sleek touch pad controls afford easy cleaning and an elegant look. Despite its space-saving size, it\'s more powerful than other choppers. So now you can prepare small quantities of food faster and more efficiently than ever before.\n- Chop or grind at the touch of a button\n- 24-ounce work bowl with handle\n- Exclusive auto-r