lymer plastic','','',3.00,'default',2031,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2013-02-05 13:00:00','2015-06-01 17:18:13'),(566410,'NZ6736','12 Cup Programmable Coffeemaker',3505,'','This classically designed coffeemaker is accented with stainless steel for a look that is sure to enhance your counter top. The 12-cup carafe features an ergonomic handle, dripless spout and knuckle guard for comfortable, drip-free pouring. Fully automatic, the DCC-1100 has 24-hour programmability and 1-4 cup setting for those times when you don\'t need a full cup of coffee. The Brew Pause feature lets you pour a cup before brewing is completed, while the gold tone coffee filter and charcoal water filter ensure fresh, delicious tasting coffee.\n- Classic design with stainless accents\n-12-cup carafe with ergonomic handle, dripless spout and knuckle guard\n- Fully automatic with 24-hour programmability, self-clean and 1 to 4-cup settings\n- Brew Pause feature lets you enjoy a cup of coffee before brewing has finished\n- 60-second reset remembers where it was in the brewing process and settings\n- Charcoal water filter\n- Gold tone filter\n- Capacity: 12 cups\n- Power: 120V\n- Cord: 3ft. length\n- 8\" W x 14.17\" H x 8.11\" D\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,13,100,'','3 year limited manufacturer warranty','Lift up the reservoir cover. Remove and discard the paper filter and ground coffee. The filter basket can be washed in warm, soapy water and rinsed thoroughly, or cleaned in the upper rack of the dishwasher. Dry all parts after use.','Stainless steel, polymer plastic, charcoal water filter, non-stick scratch resistant metal, polycarbonate glass','','',9.00,'default',1005,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2013-02-05 13:00:00','2015-06-01 17:18:13'),(56641