 processor occupies minimum counter space yet offers major advantages: more power than other choppers, 2-speed operation, large 21-ounce capacity and several colors to choose from.\n- Powerful chopper/grinder\n- 21-ounce work bowl\n- 2 speeds for precision processing\n- Patented reversible blade\n- Dishwasher-safe parts\n- Stainless steel blade with sharp and blunt edges\n- Includes spatula and instruction/recipe book\n- BPA Free\n- Capacity: 21 oz\n- Power: 120 V\n- Cord: 3 ft\n- 4.63\" W x 6.25\" D x 8\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','',0,0,0,86,100,'','18 month limited manufacturer warranty','To simplify cleaning, rinse the Prep Bowl, cover and blade immediately after use, so that food won\'t dry onto them. Wash Blade Assembly, Sheath, Prep Bowl, cover and spatula in warm soapy water. Rinse and dry. Wash the blade carefully. Avoid leaving it in soapy water where it may disappear from sight. If you have a dishwasher, you can wash the Prep Bowl, cover, Blade Assembly and spatula on the upper shelf. Insert the Prep Bowl upside-down and the cover right-side up. Put the blade and spatula in the cutlery basket. Unload the dishwasher carefully to avoid contact with the sharp blade. Wipe the motor base clean with a damp sponge or cloth. Dry it immediately. Never submerge the motor base or the plug in water or other liquid. The Mini-Prep stores neatly on the countertop in a minimum of space. When it is not in use, be sure to leave it unplugged. The hidden cord storage underneath the motor base will help to keep excess cord off the countertop. Store the unit assembled to prevent loss of parts. Store the blades as you would sharp knives--out of the reach of children.','Stainless steel','','',3.00,'default',3160,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','2013-04-09 13:00:00','2015-06-01 17:18:13'