 Featherbed ',8426,'','Our finest combination of luxurious materials and craftsmanship for an unparalleled Feather and Fiber comfort adds an extra layer of softness to your bed for an incredible sleep experience by providing extra-cushiony support to relieve pressure points, allowing you a warm and comfortable slumber night after night. A great alternative to heavy blankets and over-filled duvets, our 3-inch featherbed can be placed right on top of your existing mattress and features a divinely soft top layer filled with a specially engineered blend of white duck down and slick-gel down alternative fiber for an extra layer of softness and support and a bottom layer generously filled with white duck feathers for that extra bit of warmth. A feather-proof liner helps to keep feathers inside without poking through.\n- 233 thread count\n- Finished with a 100% Cotton cover for a clean, classic look\n- 3\" gusset and box quilting to keep filling from shifting, this feather and fiber bed delivers just the right amount of warmth, support, cushioning\n- Unparalleled feather and fiber comfort\n- For all seasons\n- Color: white\n- Imported\n\nProduct measurements: \n- Queen: 60\" x 80\" x 3\" H\n- King: 78\" x 80\" x 3\" H\n- Cal king: 72\" x 84\" x 3\" H\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','Fabric: 100% cotton\nLiner: 100% polyester\nFill top: 6oz/y2 6D polyester\nFill bottom: 50% white duck down, 50% white duck feathers',0,0,0,12,100,'','','Spot clean only','','','',28.00,'default',2020,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991240,'MFP-072','Tempure Rest Cooling Gel Reversible Memory Foam Loft Pillow - Blue',8426,'','Tempure Rest Cooling Gel Reversible Memory Foam Loft Pillow allows you the choice to sleep on either the cooling gel-infused memory foam side or the soft polyester down alternative side. The cooling gel-infused memory foam will help regulate the temperature of the pillow while you sleep while still providing the benefits of memory foam with a delighful and unique quilted pattern. The pillow is filled with soft, yet supportive superior quality hypoallergenic polyester fiber for added comfort and support with the loft and feel of a traditional down alternative pillow.\n- Back fabric is a plain knit for a smooth sleeping surface\n- As an added benefit, the cover is a contemporary knit cooling fabric and accented with blue thread\n- Easy care machine wash and dry\n- Support: Medium\n- Color: white\n- Imported\n\nProduct measurements: \n- Jumbo: 20\" x 28\"\n- King: 20\" x 36\"\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','Fabric: 100% viscose-rayon face/ 100% polyester inner/ 100% polyester back\nLiner: 100% polypropylene\nFill: 100% polyester',0,0,0,54,100,'','','Machine wash','','','',19.00,'default',2699,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991241,'MFP-073','Tempure Rest Cool MF Contour Pillow - Blue',8426,'','Tempure Rest Cool-Blue Memory Foam Pillow Contour shape is made with a revolutionary cooling memory foam. The infusion of blue cooling gel into the memory foam helps to regulate the temperature of this pillow while you sleep; that means if you have a tendency to get very hot while sleeping, you can experience a cooler, more inviting sleep thanks to the temperature regulating gel infusion. Our Cool-Blue Memory Foam Pillow is also ventilated to make the pillow breathable and further helps prevent heat build-up while you sleep. It\'s contour shape combines both head and neck support to help provide the ultimate in stress relieving support; combine this with our super soft memory foam and cooling fabric cover and your head will feel like it is resting on a cloud.\n- Support: Medium\n- Color: blue\n- Removable cover is easy care machine washable\n- 20\" x 14\" x 4.5\" H\n- Imported\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','Fabric: 100% viscose-rayon face/100% polyester inner/100% polyester back\nFill: 100% polyurethane foam',0,0,0,52,100,'','','Cover: Machine wash cold, tumble dry low. Foam: do not wash foam','','','',19.00,'default',2699,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991242,'MFP-074','Tempure Rest Cool MF Conventional Pillow - Blue',8426,'','Tempure Rest Cool-Blue Memory Foam Pillow Conventional shape is made with a revolutionary cooling memory foam. The infusion of blue cooling gel into the memory foam helps to regulate the temperature of this pillow while you sleep; that means if you have a tendency to get very hot while sleeping, you can experience a cooler, more inviting sleep thanks to the temperature regulating gel infusion. Our Cool-Blue Memory Foam Pillow is also ventilated to make the pillow breathable and further helps prevent heat build-up while you sleep. It\'s traditional shape easily fits regular pillowcases and combines both head and neck support to help provide the ultimate in stress relieving support; combine this with our super soft memory foam and cooling fabric cover and your head will feel like it is resting on a cloud.\n- Support: Medium\n- Color: blue\n- Removable cover is easy care machine washable\n- 20\" x 14\" x 4.5\" H\n- Imported\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','Fabric: 100% viscose-rayon face/100% polyester inner/100% polyester back\nFill: 100% polyurethane foam',0,0,0,71,100,'','','Cover: Machine wash cold, tumble dry low. Foam: do not wash foam','','','',19.00,'default',2699,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991243,'MFT-405','Tempure Rest Marbleized Gel 2\" Topper - Blue',8426,'','Our 2\" Tempure Rest Marbleized Gel Topper offers both the benefits of memory foam with the cooling properties of gel in this unique and functional mattress topper. Unlike many \"cooling\" memory foam products using regular cooling \"gel-beads\" that can separate and cause a mess, our special marbleized infusion of cooling gel liquid into the memory foam means the cooling properties of the gel foam are spread more evenly and thoroughly throughout the topper to better help regulate the temperature of this topper while you sleep - that means that if you have a tendency to get very hot while sleeping, you can experience a cooler, more inviting sleep thanks to the temperature regulating marbleized gel infusion. In addition, the topper is also ventilated to allow air flow and further help regulate heat build-up during sleep. Memory foam is sensitive to body temperature and changes shapes as you move to provide responsive support all night long for better sleep. \n- Support: Medium\n- Color: blue\n- Topper can be placed right on top of your existing mattress and never needs turning\n- Hypoallergenic and easy care spot clean only\n- Does not include cover\n- After unpacking, allow 24 hours for the topper to regain its loft\n- Imported\n\nProduct measurements: \n- Twin: 37\" x 75\" x 2\" H\n- Full: 52\" x 73\" x 2\" H\n- Queen: 58\" x 78\" x 2\" H\n- King: 76\" x 78\" x 2\" H\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','100% polyurethane',0,0,0,3,100,'','','Do not wash, spot clean only.','','','',9.00,'default',3566,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991244,'MFT-406','Tempure Rest Marbleized Gel 5 Zone Topper ',8426,'','1.5\" Tempure Rest Marbleized Gel 5-Zone Topper offers both the benefits of memory foam with the cooling properties of gel in this unique and functional mattress topper. Unlike many \"cooling\" memory foam products using regular cooling \"gel-beads\" that can separate and cause a mess, our special marbleized infusion of cooling gel liquid into the memory foam means the cooling properties of the gel foam are spread more evenly and thoroughly throughout the topper to better help regulate the temperature of this topper while you sleep - that means that if you have a tendency to get very hot while sleeping, you can experience a cooler, more inviting sleep thanks to the temperature regulating marbleized gel infusion. Our specially designed 5-Zone support patterns are molded right into the memory foam to help reduce pressure points that cause tossing and turning - head, shoulders, back, legs and feet - giving more support at higher compression levels so you get support precisely where it is needed. In addition, the topper is also ventilated to allow air flow and further help regulate heat build-up during sleep. Memory foam is sensitive to body temperature and changes shapes as you move to provide responsive support all night long for better sleep.\n- Support: Medium\n- Color: blue\n- Topper can be placed right on top of your existing mattress and never needs turning\n- Hypoallergenic and easy care\n- Does not include cover\n- After unpacking, allow 24 hours for the topper to regain its loft\n- Imported\n\nProduct measurements: \n- Twin: 37\" x 73\" x 1.5\" H\n- Full: 52\" x 73\" x 1.5\" H\n- Queen: 58\" x 78\" x 1.5\" H\n- King: 76\" x 78\" x 1.5\" H\r\n\r\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','100% polyurethane',0,0,0,2,100,'','','Spot clean only','','','',9.00,'default',3566,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991245,'MP-079','Tempure Rest Cooling Gel Memory Foam Mattress Pad - Blue',8426,'','Our Tempure Rest Cooling Gel Memory Foam Mattress Pad allows you to sleep cool while protecting your mattress at the same time. The Cooling Gel Memory Foam Mattress Pad is specially designed so that the top layer of the pad is made with cooling gel-infused memory foam which will help regulate the temperature of this mattress pad during your sleep while still providing the benefits of memory foam. The bottom layer contains a layer of soft, yet supportive, superior quality hypoallergenic polyester fiber for added comfort; both layers are quilted together in a delighful and unique quilted pattern.\n- Weight: All season\n- Color: blue\n- As an added benefit, the cover is a contemprary knit cooling fabric and accented with blue thread with an integrated stetchy skirt to fit mattresses 18-22\" deep\n- Imported\n\nProduct measurements: \n- Twin: 39\" x 75\"\n- Full: 54\" x 75\"\n- Queen: 60\" x 80\"\n- King: 78\" x 80\"\n- Cal king: 72\" x 84\"\n\nPlease note your order will be shipped directly from the brand. Orders cannot be shipped to Australia, Canada, Alaska, Hawaii, Puerto Rico or P.O. Boxes.','Fabric: 240gsm 100% rayon top, 100% polyester middle, 100% polyester bottom\nBack: 80gsm non-woven 100% polyethene\nSkirt: 100% polyester',0,0,0,6,100,'','','Easy care machine wash and dry.','','','',19.00,'default',2020,NULL,'CN',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:33:50'),(991246,'MP-109','England Cotton Diamond Mattress Pad ',8426,'','The Royal solution for luxurious comfort and protection, our BEHRENS England Cotton Diamond Mattress Pad boasts added comfort for you and protection for your mattress with a beautiful 300 thread-count 100% Cotton Diamond fabric cover, decorative di