dd a little humor to your home decor with this fun kitchen towel. It\'s sure to keep everybody laughing!\n- 17\" W x 22\" L\n- Made in USA','100% cotton',0,0,0,0,100,'','','Machine wash, no bleach','','','',1.00,'default',910,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:17:34'),(1304795,'13-17-3266','Nothing Says a Good Time Pom Pom Wine Bottle Bag',14795,'','Carry your favorite bottle to-and-from in this adorable carrying bah.\n- 13\" W x 6\" L\n- Made in USA','100% cotton',0,0,0,0,100,'','','Machine wash','','','',1.00,'default',848,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:17:34'),(1304796,'17-3257','If It Weren\'t For The Cocktails Kitchen Towel',14795,'','Add a little humor to your home decor with this fun kitchen towel. It\'s sure to keep everybody laughing!\n- 17\" W x 22\" L\n- Made in USA','100% cotton',0,0,0,0,100,'','','Machine wash, no bleach','','','',1.00,'default',910,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:17:34'),(1305035,'640213720205','Collagen Hair Mist',15060,'','Target client: Overprocessed or damaged hair; hair with split ends or breakage.\nResults: Replenishes collagen protein to revitalize, strengthen, thicken and plump hair; reconstructs damaged hair to restore brilliant shine. \n- Size: 8 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA\n','',0,0,0,0,100,'','','','','','Directions: \nWash hair with RG cosmetics collagen shampoo and towel-dry. Spray hair with the RG Cosmetics collagen hair mist, focusing on the ends. Spread product throughout hair by brushing hair with a comb. Blow-dry hair to perfect finish. Flat Iron Hair, sealing cuticle and ends. Style as usual. Maintain treatment with the collagen Mask. \n\nIngredients: \naqua, cetearyl alcohol, collagen, propanediol, glycerin, polyquaternium - 55,soytrimunium chloride, cocunut oil, simmondsia chinenensis(jojoba) seed oil, citrus aeration dulcis(orange)oil, hydrolized sweet almond protein, aloe barbadensis leaf juice, squalene, curcuma longa(turmeric)root extract, creatine, panthenol, panthenyl ethyl/ ether, adenosine phosphate, hydrolyzed wheat protein pg %u2013 propyl silanetriol, tocopheryl acetate, phospholipids, phytantriol, linoleic acid, polyquaternium 11, fragrance, saccharomyces/magnesium ferment,saccharomyces/copper ferment, saccharomyces/zinc ferment, saccharomyces/iron ferment, butylene glycol, c11-15 pareth-7, laureth-9, trideceth-12, isopropyl alcohol, potassium sorbate, caprylyl glycol, disodium edta, citric acid, phenoxyethanol, methylisothiazolinone.',0.00,'default',3019,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:30:48'),(1305036,'640213720151','Professional Size HairB Mask ',15060,'','This intensive hydrating mask goes the extra mile when you need intensive moisture, damage control or a reconstructing boost between HairB treatments. It penetrates each strand to replenish moisture and improve the look and feel of hair from the inside out, leaving it smooth, silky and healthy looking. \n- Size: 33 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA\n','',0,0,0,0,100,'','','','','','Directions:\nApply a generous amount of mask to hair, focusing on the ends. Gently work through hair and leave-in for 2-3 minutes. Rinse with warm water, style\nas usual. \n\nIngredients:\naqua (water), cetearyl alcohol, cetrimonium chloride, c12-20 isoparaffin,  cetearyl alcohol (and) behentrimonium methosulfate, cyclomethicone / dimethicone,  cocosnucifera oil, peg 180m, phenoxyethanol / methylparaben / ethylparaben propylparaben / butylparaben / isobutyparaben, parfum (fragrance), cl 19140, cl 47005. ',0.00,'default',3019,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:30:48'),(1305037,'640213720571','Professional Size HairB Shampoo ',15060,'','It\'s shampoo that does more: HairB Shampoo replenishes moisture, improves manageability, and helps to strengthen hair as it cleanses. The secret: a combination of natural oils that restore damaged hair and leave it shiny, silky and protected with every wash. HairB Shampoo also enhances the results of the HairB treatment.\n- Size: 33.81 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA\n','',0,0,0,0,100,'','','','','','Directions:\nCoat wet hair with liberal amount of shampoo. Gently massage shampoo from the scalp to the root, working into lather (use twice if after HairB Treatment). Rinse hair and \nrepeat as needed. For best results, use with HairB Mask.\n\nIngredients:\naqua (water), sodium methylcocoyltaurate, cocoamidopropyl betaine, cocoamide dea, persea gratissima oil, bertholletia excelsa seed oil, parfum (fragrance), sodium pca (and) serine (and) glycine (and) glutamic acid (and) alanine (and) lysine (and) arginine (and) theronine (and) proline (and) betaine (and) sorbitol, methyl isothiazolinone, methyl chloto isothiazolinone, citric acid, disodium edta, propylene glycol, polyquaternium 10, peg 150-distearate, glycol distearate, bismuth oxychloride.',0.00,'default',1901,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:30:48'),(1305038,'736211553317','Argan Oil',15060,'','This lightweight oil harnesses the powerful properties of argan to deliver amazing moisture, silkiness and shine. \n- Size: 1.7 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA','',0,0,0,0,100,'','','','','','Directions:\nApply 2-4 drops in your hand, rub and distribute evenly throughout hair.\n\nIngredients:\nCyclopentasiloxane, Dimethicone, Crosspolymer, Argania, Spinosa(Argan) Oil. ',0.00,'default',2375,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:30:48'),(1305039,'736211555519','Keratin X-press',15060,'','Skip the salon blow-out and create a perfectly sleek blow-dry at home, every time. Keratin X-press delivers a touch of keratin and Argan oil with each use to smooth, strengthen and control frizz all day, for a flawless, just-left-the-salon finish. It helps your blow-dry last longer, while protecting against dullness and dryness caused by frequent heat styling and flat ironing.\n- Size: 8 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA','',0,0,0,0,100,'','','','','','Directions:\nPour a small amount into palm of hands, then apply evenly throughout the hair. Suitable for daily use on towel dried hair. Blow dry or flat iron and style as desired.\n\nIngredients:\naqua, titanuium, dioxide, polyquaternium-37, propylen glycol, dicaprylate, ppg-1 trideceth 6, cyclopentasiloxane, dimethiconol, parfum (fragrance), mineral oil, dmdm hydantoin, argain oil.',0.00,'default',1904,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,'weight',NULL,0,'2015-06-19 19:18:41','0000-00-00 00:00:00','2015-06-01 17:30:48'),(1305040,'640213720090','Collagen Mask - 8 oz. ',15060,'','Target client: Dry, damaged hair.\nResults: Moisturizes and reconstructs hair; enhances the results of RG Cosmetics hair treatments. \n- Size: 8 oz. \n- For directions and ingredients, see \"Additional Info\"\n- Made in USA','',0,0,0,0,100,'','','','','','Directions:\nWeekly moisturizing and revitalizing hair mask infused with collagen. Recommended use to enhance and maintain the RG cosmetics collagen hair treatment. After Washing hair with shampoo, apply a generous amount of mask to hair, focusing on the ends. Gently work through hair and leave-in for 2-3 minutes. Rinse with warm water and style as usual. \n\nIngredients:\naqua (water), cetearyl alcohol, collagen, dimethicone, cethyl esters,  coconut oil, hydroxyethylcelulose, triticum vulgare (wheat) germ extract, hydrolyzed wheat,